  true,\n\t\"url\": null,\n\t\"notes\": \"ERS has been a source of major land use
  estimates in the United States for over 50 years, and the related U.S. cropland
  used for crops series dates back to 1910. The Major Land Uses (MLU) series is the
  longest running, most comprehensive accounting of all major uses of public and private
  land in the United States. The series was started in 1945, and has since been published
  about every 5 years, coinciding with the Census of Agriculture. See the latest report
  in the series, Major Uses of Land in the United States, 2007.rn rnData from all
  14 Major Land Uses reports have been combined into a set of files showing major
  land use estimates by region and State from 1945 to 2007. Alaska and Hawaii were
  added in 1959, when they achieved Statehood. Since Alaska contains such vast acreage,
  50-State totals in all categories prior to 1959 may appear to change precipitously.\",\n\t\"license_title\":
